branchCategory.description:
&lt;p&gt;
The C85 series conforms to ISO 6432 and CETOP RP52P. The C85 is available in bore sizes 8mm through 25mm with standard strokes ranging from 10mm through 300mm. A unique rod packing design prevents entry of dust and the effectiveness of the seal is such that the C85 is suitable for use in extremely dusty environments. With abrasion resistant packings and replaceable piston rod seals, the C85 offers exceptional service life.
&lt;/p&gt;

